import React, {Component} from 'react';



class Movie extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            show:true
         }
    }
    render() { 
        return (
            <div>
                {this.state.show ? <div>{this.props.posterurl}</div> : none}
            </div>
        )
    }
}

export default Movie;
